import { useState } from "react";

const PhotoStrip = () => {
    const [sessionPhotos, setSessionPhotos] = useState([]);
    const getData = () => {
        fetch("http://localhost:8000/data")
            .then((res) => res.json())
            .then(
                (result) => {
                    console.log(result);
                    setSessionPhotos(result.currentCapture);
                },
                (error) => {
                    console.log(error);
                }
            );
    };

    const photoImages = sessionPhotos.map((p) => {
        return (
            <img
                src={`http://localhost:8000/images/${p}`}
                alt="photobooth pic"
                key={p}
            />
        );
    });
    return <div>{photoImages}</div>;
};

export default PhotoStrip;
